export default function App()
{
    async function getData()
    {
        try 
        {
          let response = await fetch("https://storage.googleapis.com/programiz-static/hiring/software/job-listing-page-challenge/data.json");
          return response.json();
        }
        catch(error)
        {
          console.error(error);
        }
    }

    let extract;


    const data = getData();

    data.then((result) => {extract = result});

    console.log(extract);

    return(
        <div>
            Test
        </div>
    );
}
